Health-Medical Documentary hosted by Antony Barnett, published by Channel 4 broadcasted as part of CH4 Dispatches series in 2014 - English narration


Information
------------------------------

The Cost of Cheap Alcohol
With the World Cup dominating the TV schedules, supermarkets are seeing a surge in demand for alcohol. However, with some multipack offers working out at less than 70p for a can of beer, as well as deals on cider and vodka, there is concern that the wide availability of cheap booze may have a darker side. Alcohol-related crime, violence, accidents and disease are costing the UK billions every year. Antony Barnett travels around Britain examining how drinking habits have changed and investigating how companies have mobilised to fight off government attempts to clamp down on bargain prices

